import React from 'react';
import MenuIcon from 'mdi-react/MenuIcon'

const Navbar = () => {
    return (
        <nav className='navbar bg-dark'>
            <h1><a href="index.html">
                <MenuIcon />
            </a>
            </h1>
            <ul>
                <li>
                    <a href="profiles.html" />
                </li>
            </ul>

        </nav>
    )
}

export default Navbar;
